import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 19.2-407 Review by the Supreme Court.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-407.md","filePath":"vacode/19.2-407.md"}'),o={name:"vacode/19.2-407.md"},i=a('<h1 id="§-19-2-407-review-by-the-supreme-court" tabindex="-1">§ 19.2-407 Review by the Supreme Court. <a class="header-anchor" href="#§-19-2-407-review-by-the-supreme-court" aria-label="Permalink to &quot;§ 19.2-407 Review by the Supreme Court.&quot;">​</a></h1><p>Pursuant to § <a href="http://law.lis.virginia.gov/vacode/17.1-409/" target="_blank" rel="noreferrer">17.1-409</a>, the Supreme Court in its discretion may certify an appeal taken pursuant to § <a href="http://law.lis.virginia.gov/vacode/19.2-398/" target="_blank" rel="noreferrer">19.2-398</a>, or a cross appeal taken pursuant to § <a href="http://law.lis.virginia.gov/vacode/19.2-401/" target="_blank" rel="noreferrer">19.2-401</a>, for expedited review by the Supreme Court before it has been determined by the Court of Appeals. Such certification may be made only when the Supreme Court determines that at least one of the conditions set forth in subsection B of § <a href="http://law.lis.virginia.gov/vacode/17.1-409/" target="_blank" rel="noreferrer">17.1-409</a> exists.</p><p>1987, c. 710.</p>',3),n=[i];function s(c,p,h,l,_,u){return t(),r("div",null,n)}const m=e(o,[["render",s]]);export{f as __pageData,m as default};
